(11, 14, 6420595715882, '  Are you social? Connect your facebook profile and add your website with your facebook group/page  ', '  Are you social? Connect your facebook profile and add your website with your facebook group/page  ', '{\"sunday_from\":\"13:38\",\"sunday_to\":\"13:39\",\"monday_from\":\"\",\"monday_to\":\"\",\"tuesday_from\":\"\",\"tuesday_to\":\"\",\"wednesday_from\":\"\",\"wednesday_to\":\"\",\"thursday_from\":\"\",\"thursday_to\":\"\",\"friday_from\":\"\",\"friday_to\":\"\",\"saturday_from\":\"\",\"saturday_to\":\"\"}', NULL, 'A cleaner or a cleaning operative is a type of industrial or domestic worker who cleans homes or commercial premises for payment. Cleaning operatives may specialise in cleaning particular things or places, such as window cleaners. Cleaning operatives often work when the people who otherwise occupy the space are not around. They may clean offices at night or houses during the workday.', '{\"pic\":[\"281552982844.png\",\"0bfe1182dabb4464a6fd977c06f8d32e_1984307596.png\"]}', NULL, NULL, NULL, NULL, '2019-03-19 06:29:14', '2019-03-19 10:22:50', 0, 10, 1, 0),
(12, 15, 5199527968526, '     Baby Sitting     ', '          ', '{\"sunday_from\":\"\",\"sunday_to\":\"\",\"monday_from\":\"13:41\",\"monday_to\":\"13:41\",\"tuesday_from\":\"13:41\",\"tuesday_to\":\"13:41\",\"wednesday_from\":\"\",\"wednesday_to\":\"\",\"thursday_from\":\"\",\"thursday_to\":\"\",\"friday_from\":\"\",\"friday_to\":\"\",\"saturday_from\":\"\",\"saturday_to\":\"\"}', NULL, 'Babysitting is temporarily caring for a child. Babysitting can be a paid job for all ages; however, it is best known as a temporary activity for young teenagers who are too young to be eligible for employment in the general economy. It provides autonomy from parental control, and spending money, as well as an introduction to the techniques of child care. It emerged as a social role for teenagers in the 1920s, and became especially important in suburban America in the 1950s and 1960s, when there was an abundance of small children. It stimulated an outpouring of folk culture in the form of urban legends, pulp novels, and horror films.[1]', '{\"pic\":[\"281552983058.jpg\",\"0bfe1182dabb4464a6fd977c06f8d32e_1826814504.png\"]}', NULL, NULL, NULL, NULL, '2019-03-19 08:09:39', '2019-04-04 06:41:50', 0, 10, 0, 0),
(13, 16, 4551559266388, '                  ', '                  ', '{\"sunday_from\":\"\",\"sunday_to\":\"\",\"monday_from\":\"\",\"monday_to\":\"\",\"tuesday_from\":\"\",\"tuesday_to\":\"\",\"wednesday_from\":\"\",\"wednesday_to\":\"\",\"thursday_from\":\"14:39\",\"thursday_to\":\"14:39\",\"friday_from\":\"14:39\",\"friday_to\":\"14:39\",\"saturday_from\":\"\",\"saturday_to\":\"\"}', NULL, 'A plumber is a tradesperson who specializes in installing and maintaining systems used for potable (drinking) water, sewage and drainage in plumbing systems. The term dates from ancient times and is related to the Latin word for lead, \"plumbum\".[1][2]', '{\"pic\":[\"341552986543.jpg\"]}', NULL, NULL, NULL, NULL, '2019-03-19 09:06:32', '2019-04-08 10:15:36', 0, 30, 0, 0),
