(56, 35, 5, 41, 'Woodland offers an extensive line of footwear, performance apparel and outdoor gear. Whether it\'s a lightweight jacket for active pursuits or a summit tested parka for the coldest places on earth, the focus is on creating truly functional solutions for outdoor and adventure enthusiasts. Whether you\'re new to outdoor adventure or are a seasoned pro, Woodland\'s gear keeps you dry and warm for the trails and slopes, wherever you go.', 3, 0, '2019-04-12 06:31:07', '2019-04-12 06:38:40'),
