(12, 9459344541987, 5, 'Woodland\'s parent', 'Woodland\'s parent company, Aero Group, has been a well known name in the outdoor shoe industry since the early 50s. Founded in Quebec, Canada, it entered the Indian market in 1992. Before that, Aero Group was majorly exporting its leather shoes to USSR. After the dissolution of the Soviet Union into various states, the group decided to launch some of its products in India. Hence, the first hand-stitched leather shoe was launched, which took the entire shoe market by storm. That shoe made the brand \'Woodland\'.', 35, 'Linux', '{\"pic\":[\"921554449794.png\"]}', '', 1, '2019-04-05 07:36:34', '2019-04-05 07:36:34'),
